WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-TJA-0096/2021' AND ra.N_Codigo_Tipo_Auto=4 AND ra.D_Fecha_Emision= '2021-12-15 00:00:00.000' THEN 5312
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-TJA-0096/2021' AND ra.N_Codigo_Tipo_Auto=7 AND ra.D_Fecha_Emision= '2022-01-07 00:00:00.000' THEN 5313
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-TJA-0096/2021' AND ra.N_Codigo_Tipo_Auto=10 AND ra.D_Fecha_Emision=    '2022-02-25 00:00:00.000' THEN 5314
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-TJA-0096/2021' AND ra.N_Codigo_Tipo_Auto=12 AND ra.D_Fecha_Emision=    '2022-03-24 00:00:00.000' THEN 5315
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-TJA-0096/2021' AND ra.N_Codigo_Tipo_Auto=14 AND ra.D_Fecha_Emision=    '2022-02-04 00:00:00.000' THEN 5316
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-TJA-0096/2021' AND ra.N_Codigo_Tipo_Auto=56 AND ra.D_Fecha_Emision=    '2022-01-20 00:00:00.000' THEN 5317
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-TJA-0096/2021' AND ra.N_Codigo_Tipo_Auto=64 AND ra.D_Fecha_Emision=    '2022-01-12 00:00:00.000' THEN 5318
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-TJA-0097/2021' AND ra.N_Codigo_Tipo_Auto=4 AND ra.D_Fecha_Emision= '2021-12-20 00:00:00.000' THEN 5319
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-TJA-0097/2021' AND ra.N_Codigo_Tipo_Auto=7 AND ra.D_Fecha_Emision= '2022-01-07 00:00:00.000' THEN 5320
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-TJA-0097/2021' AND ra.N_Codigo_Tipo_Auto=10 AND ra.D_Fecha_Emision=    '2022-02-25 00:00:00.000' THEN 5321
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-TJA-0097/2021' AND ra.N_Codigo_Tipo_Auto=14 AND ra.D_Fecha_Emision=    '2022-02-04 00:00:00.000' THEN 5322
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-TJA-0097/2021' AND ra.N_Codigo_Tipo_Auto=25 AND ra.D_Fecha_Emision=    '2022-01-26 00:00:00.000' THEN 5324
WHEN LTRIM(RTRIM(ra.C_Nro_Expediente))='ARIT-TJA-0097/2021' AND ra.N_Codigo_Tipo_Auto=56 AND ra.D_Fecha_Emision=    '2022-01-28 00:00:00.000' THEN 5325

    END)                                                        AS id_actuacion,
             ra.N_Codigo_Destinatario                           AS id_tipo_demandante,
             ra.N_Codigo_Tipo_Not                               AS id_tipo_notificacion,
             D_Fecha_Hora_Notificacion                          AS fecha_hora_notificacion,
             1                                                  AS estado,
             1                                                  AS id_usuario_registra,
             GETDATE()                                          AS fecha_registra,
             NULL                                               AS id_usuario_modifica,
             NULL                                               AS fecha_modifica,
             ra.D_Fecha_Emision                                 AS fecha_actuacion_registro,
             (SELECT CASE
                         WHEN (tra.N_Codigo_Super_Reg IS NULL AND ISNUMERIC(tra.N_Codigo_Intendencia) = 1)
                             THEN tra.N_Codigo_Intendencia + 4
                         WHEN (ISNUMERIC(tra.N_Codigo_Super_Reg) = 1 AND tra.N_Codigo_Intendencia IS NULL)
                             THEN tra.N_Codigo_Super_Reg
                         WHEN (ISNUMERIC(tra.N_Codigo_Super_Reg) = 1 AND ISNUMERIC(tra.N_Codigo_Intendencia) = 1)
                             THEN tra.N_Codigo_Super_Reg
                         END
              FROM TSS_RECURSOS_ALZADA AS TRA
              WHERE TRA.C_Nro_Expediente = ra.C_Nro_Expediente) AS id_region_radicatoria,
             ra.C_Nro_Expediente
      FROM TSS_NOTIFICACIONES AS ra
      WHERE (ra.C_Nro_Expediente LIKE 'ARIT-TJA-%/2021%' OR ra.C_Nro_Expediente LIKE 'ARIT-TJA-%/2022%')
        AND ra.N_Codigo_Tipo_Auto NOT IN (22, 23)) AS temp
WHERE temp.id_actuacion IS NOT NULL
ORDER BY temp.C_Nro_Expediente;
